// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "./RTToken.sol";


contract Marketplace is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _Ids;
    address payable public marketAddress;

    struct TokenInfo {
        uint256 id;
        address payable seller;
        address NFTaddress;
        uint256 tokenId;
        uint256 price;
        string metadata;
        bool sold;
        uint256 creatorFee;
        uint256 openingPrice; // 
        uint256 auctionEndTime; //   
        address payable highestBidder; //   
        uint256 highestBid; //  
    }

    mapping(uint256 => TokenInfo) public TokenOnSale;
    mapping(address => uint256) public lowestPriceByCollection;
    mapping(address => uint256) public totalSalesByCollection;

    event Add(uint256 id, address indexed NftAddress, address indexed seller, uint256 tokenId, uint256 price, string metadata, uint256 creatorFee);
    event Buy(uint256 id, address indexed NftAddress, address indexed seller, address indexed buyer, uint256 tokenId, uint256 price);
    event AuctionCreated(uint256 id, address indexed NftAddress, address indexed seller, uint256 tokenId, uint256 openingPrice, uint256 auctionEndTime);
    event BidderChanged(uint256 id, address indexed NftAddress, address indexed bidder, uint256 tokenId, uint256 bidAmount);
    event AuctionEnded(uint256 id, address indexed NftAddress, address indexed seller, address indexed winner, uint256 tokenId, uint256 winningBid);
    event AuctionCancelled(uint256 id, address indexed NftAddress, address indexed seller, uint256 tokenId);

    constructor() {
        marketAddress = payable(msg.sender);
    }

    function addNftToMarket(address _NFTaddress, uint256 _tokenId, uint256 _price, string memory _metadata, uint256 _creatorFee) external {
        require(ERC721(_NFTaddress).ownerOf(_tokenId) == msg.sender, "You are not the owner of this NFT");

        _Ids.increment();
        TokenOnSale[_Ids.current()] = TokenInfo(_Ids.current(), payable(msg.sender), _NFTaddress, _tokenId, _price, _metadata, false, _creatorFee, 0, 0, payable(address(0)), 0);
        if (_price < lowestPriceByCollection[_NFTaddress] || lowestPriceByCollection[_NFTaddress] == 0) {
            lowestPriceByCollection[_NFTaddress] = _price;
        }

        emit Add(_Ids.current(), _NFTaddress, msg.sender, _tokenId, _price, _metadata, _creatorFee);
    }


    function buyNfts(uint256[] calldata _ids) external payable {
        require(msg.value > 0, "No ETH sent");

        for (uint256 i = 0; i < _ids.length; i++) {
            buyNft(_ids[i]);
        }
    }

    function buyNft(uint256 _id) public payable {
        TokenInfo storage token = TokenOnSale[_id];
        require(msg.value >= token.price, "Not enough ETH");
        require(!token.sold, "Already sold out");
        require(msg.sender != token.seller, "You can't buy your own NFT");
        require(token.openingPrice == 0, "During the auction, you can't buy this NFT");

        uint256 tokenPrice = token.price;
        uint256 marketFee = tokenPrice / 100;
        uint256 creatorRoyalty = token.price * token.creatorFee / 1000;
        uint256 sellerAmount = tokenPrice - marketFee - creatorRoyalty;

        marketAddress.transfer(marketFee);

        address payable creator = RTToken(token.NFTaddress).getCreator();
        if (token.seller != creator) {
            creator.transfer(creatorRoyalty);
        }

        token.seller.transfer(sellerAmount);

        totalSalesByCollection[token.NFTaddress] += token.price;
        token.sold = true;
        token.seller = payable(msg.sender);

        emit Buy(_id, token.NFTaddress, token.seller, msg.sender, token.tokenId, token.price);
    }

    function reAddNftToMarket(uint256 _id, uint256 _price) external {
        TokenInfo storage token = TokenOnSale[_id];
        require(token.sold, "This NFT is not sold");
        require(msg.sender == token.seller, "You are not the owner of this NFT");

        token.price = _price;
        token.sold = false;

        emit Add(_id, token.NFTaddress, token.seller, token.tokenId, _price, token.metadata, token.creatorFee);
    }

    function startAuction(uint256 _id, uint256 _openingPrice, uint256 _duration) external {
        TokenInfo storage token = TokenOnSale[_id];
        require(!token.sold, "Already sold out");
        require(msg.sender == token.seller, "You are not the owner of this NFT");
        require(_openingPrice > 0, "Invalid opening price");
        require(_duration > 0, "Invalid auction duration");

        token.openingPrice = _openingPrice;
        token.auctionEndTime = block.timestamp + _duration;

        emit AuctionCreated(_id, token.NFTaddress, token.seller, token.tokenId, _openingPrice, token.auctionEndTime);
    }

    function bidInAuction(uint256 _id) external payable {
        TokenInfo storage token = TokenOnSale[_id];
        require(!token.sold, "Already sold out");
        require(token.openingPrice > 0, "Auction not started");
        require(block.timestamp < token.auctionEndTime, "Auction not ended yet");
        require(msg.value > token.highestBid, "Bid amount is too low");

        if (token.highestBid != 0) {
            token.highestBidder.transfer(token.highestBid); //      
        }

        token.highestBidder = payable(msg.sender);
        token.highestBid = msg.value;

        emit BidderChanged(_id, token.NFTaddress, msg.sender, token.tokenId, msg.value);
    }

    function endAuction(uint256 _id) internal {
        TokenInfo storage token = TokenOnSale[_id];
        address owner = IERC721(token.NFTaddress).ownerOf(token.tokenId);

        require(!token.sold, "Already sold out");
        require(token.openingPrice > 0, "Auction not started");
        require(block.timestamp >= token.auctionEndTime, "Auction has not ended yet");
        // require(owner == msg.sender, "You are not the owner of this NFT");

        //      NFT    
        IERC721(token.NFTaddress).safeTransferFrom(owner, token.highestBidder, token.tokenId);
        token.seller.transfer(token.highestBid);
        token.sold = true;
        token.seller = payable(token.highestBidder);

        //    
        token.openingPrice = 0;
        token.auctionEndTime = 0;
        token.highestBidder = payable(address(0));
        token.highestBid = 0;

        emit AuctionEnded(_id, token.NFTaddress, token.seller, token.highestBidder, token.tokenId, token.highestBid);
    }

    function timer() external {
        for (uint256 i = 1; i <= _Ids.current(); i++) {
            TokenInfo storage token = TokenOnSale[i];
            if (!token.sold && token.openingPrice > 0 && block.timestamp >= token.auctionEndTime && token.highestBidder != address(0)) {
                require(msg.sender == token.highestBidder, "Only last highest bidder can end the auction");
                endAuction(i);
            }
        }
    }

    function cancelAuction(uint256 _id) external {
        TokenInfo storage token = TokenOnSale[_id];
        require(token.id != 0, "Token not found");
        require(token.openingPrice > 0, "Auction not started");
        require(!token.sold, "Token is already sold");
        require(msg.sender == token.seller, "You are not the seller");

        token.sold = true;
        token.highestBidder.transfer(token.highestBid);
        IERC721(token.NFTaddress).safeTransferFrom(token.seller, token.seller, token.tokenId);

        emit AuctionCancelled(token.id, token.NFTaddress, token.seller, token.tokenId);
    }

    function getAllTokensInCollection(address _NFTaddress) external view returns (TokenInfo[] memory) {
        uint256 count = 0;
        for (uint256 i = 1; i <= _Ids.current(); i++) {
            if (TokenOnSale[i].NFTaddress == _NFTaddress) {
                count++;
            }
        }
        TokenInfo[] memory tokens = new TokenInfo[](count);

        uint256 index = 0;
        for (uint256 i = 1; i <= _Ids.current(); i++) {
            if (TokenOnSale[i].NFTaddress == _NFTaddress) {
                tokens[index] = TokenOnSale[i];
                index++;
            }
        }

        return tokens;
    }
}
